import React from 'react';
import Card from '../UI/Card';
import './UsersList.css';

export default function UsersList(props) {
    return(
        <Card className='users'>
        <ul>
            {props.users.map((user, index)  =>(
                <li key={index}>
                    {user.name} ( {user.age} years old )
                </li>
            ))}
        </ul>
        </Card>
    )
}
